import styled from "styled-components";

export const Grid1 = styled.div`
grid-column: 1 / 1;
grid-row: 1 / 2;
}
`;

export const Grid2 = styled.div`
grid-column: 1;
grid-row: 2 / 2;
@media(min-width: 600px){
    grid-column: 2;
    grid-row: 1 / 2;
}
`;

export const Grid3 = styled.div`
grid-column: 1;
grid-row: 3;
margin-left: 80px;
margin-right: 80px;
text-align: center;
padding: 0.5em 1em;
border: 2px solid palevioletred;
border-radius: 8px;

@media(min-width: 600px){
    grid-column: 1;
    grid-row: 2;
    margin-top: -60px;
}`;
